var $bm_rt;
var freq, decay, n, n, t, v, amp;
freq = 1;
decay = 3;
$bm_rt = n = 0;
if ($bm_sum(numKeys, 0)) {
    $bm_rt = n = nearestKey(time).index;
    if ($bm_sum(key(n).time, time)) {
        n--;
    }
}
if ($bm_sum(n, 0)) {
    t = $bm_sub(time, key(n).time);
    v = velocityAtTime(key(n).time - thisComp.frameDuration / 10);
    amp = $bm_mul($bm_mul(v, freq), Math.exp(-decay * t));
    $bm_rt = $bm_sum(value, $bm_mul(amp, Math.sin(freq * t * Math.PI * 2)));
} else {
    $bm_rt = value;
}

